import Logo from "./Logo";
import swift from 'programming-languages-logos/src/swift/swift.svg'

const Skills = () => {
    return ( 
        <div>
            <Logo imgLink="https://cdn.jsdelivr.net/npm/programming-languages-logos/src/javascript/javascript.png"/>
            <Logo imgLink="https://cdn.jsdelivr.net/npm/programming-languages-logos/src/java/java.png"/>
            <Logo imgLink="https://cdn.jsdelivr.net/npm/programming-languages-logos/src/python/python.png"/>
            <Logo imgLink="https://cdn.jsdelivr.net/npm/programming-languages-logos/src/c/c.png"/>
            <Logo imgLink="https://cdn.jsdelivr.net/npm/programming-languages-logos/src/html/html.png"/>
            <Logo imgLink="https://cdn.jsdelivr.net/npm/programming-languages-logos/src/css/css.png"/>
            <Logo imgLink="https://cdn.jsdelivr.net/npm/programming-languages-logos/src//c.png"/>





             <br /><br />Skills
            <br /> - Languages: Java, Python, C, HTML, CSS (Tailwind), JavaScript (ReactJS, NodeJS, ExpressJS)
            <br /> - Familiar with Databases (MongoDB, SQL)
            <br /> - Proficient in Microsoft Office Suite
            <br /> - Knowledge in Unix
            <br /> - Project and Time Management Strategic-thinking and Problem-solving abilities
        </div>
     );
}

export default Skills;
